sys_variable_value.value:
(function execute(inputs, outputs) {

gs.include("ethjs-signer");

var payload2 = JSON.parse(inputs.payload2.toString());

outputs.txraw = ethSigner.sign(payload2, inputs.key.private_key.toString(), false);

gs.info(outputs.txraw);
})(inputs, outputs);

